import { Link } from "react-router-dom";
import selfie from "../images/profile_pic.png";

export default function Top() {
  return (
    <div>
      <img src={selfie} className="top-img" alt="selfie" />
      <h1 className="top-name">Hong Li</h1>
      <h4 className="top-label">My Links</h4>
      <div className="button-container">
        <Link to="https://github.com/hongli-95">
          <button className="button-one">Github</button>
        </Link>
        <Link to="https://www.linkedin.com/in/hong-li-7b2761161/">
          <button className="button-two">LinkedIn</button>
        </Link>
      </div>
    </div>
  );
}
